import React, { Component } from "react";
class Home extends Component {
  render() {
    return (
      //   <div id="slider">
      //   <figure>
      //     <img src="https://mdbootstrap.com/img/Photos/Slides/img%20(70).jpg" alt=""/>
      //     <img src="https://mdbootstrap.com/img/Photos/Slides/img%20(129).jpg" alt =""/>
      //     <img src="https://mdbootstrap.com/img/Photos/Slides/img%20(130).jpg" alt =""/>
      //     <img src="ankor-wat.jpg" alt/>
      //     <img src="austin-fireworks.jpg" alt/>
      //   </figure>
      // </div>

      <div>
        <section id="slideshow">

          <div class="container">
            <div class="c_slider"></div>
            <div class="slider">
              <figure>
                <img src="img/dummy-640x310-1.jpg" alt="" width="640" height="310" />
                <figcaption>The mirror of soul</figcaption>

              </figure>
              <figure>
                <img src="img/dummy-640x310-2.jpg" alt="" width="640" height="310" />
                <figcaption>Let's cross that bridge when we come to it</figcaption>
              </figure>
              <figure>
                <img src="img/dummy-640x310-3.jpg" alt="" width="640" height="310" />
                <figcaption>Sushi<em>(do)</em> time</figcaption>

              </figure>
              <figure>
                <img src="img/dummy-640x310-4.jpg" alt="" width="640" height="310" />
                <figcaption>Waking Life</figcaption>
              </figure>
            </div>
          </div>

          <span id="timeline"></span>
        </section>
      </div>

    );
  }
}

export default Home;
